webpackJsonp([0xfc0d9785d03f],{1512:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2008-01-07-top-selling-stuff-on-amazon-brings-tears/index.md absPath of file >>> MarkdownRemark",html:'<p>I am always looking for a deal so I keep trying to find one on Amazon Grocery. The problem is that you can waste a lot of time trying to find something you would really buy.</p>\n<p>So I try the top sellers page:</p>\n<p><a href="http://www.amazon.com/gp/bestsellers/grocery/ref=sv%5C_gro%5C_1/104-6217951-1925564">http://www.amazon.com/gp/bestsellers/grocery/ref=sv_gro_1/104-6217951-1925564</a></p>\n<p>Notice the top sellers are baby items, coffee and diet pills (at least they are right now) and deep in my heart I have to feel bad for all the mothers who are up late with the kids and trying to lose weight.</p>\n<p>No wonder we are a Prozac nation.</p>',frontmatter:{title:"Top Selling Stuff on Amazon Brings Tears",date:"January 07, 2008",imageUrl:null,image:null}}},pathContext:{path:"/top-selling-stuff-on-amazon-brings-tears"}}}});
